export default function Home(props)
{
    const divstyle={
        marginTop: '40px',
        color:"red"
    }
    return <div style={divstyle}
    
    >
        המבורגר הוא המאכל האידיאלי עבור מערכת העיכול. אם ברצוננו לפתח את הקיבה ולהעניק לה סיבים תזונתים ובריאים- עשו את הדבר הנכון ותאכלו המבורגר.
    </div>
}
